import React, { Component } from 'react';
import Data from '../data';
import Pokemon from './Pokemon';

class Pokedex extends Component {
  render() {
    return Data.map(pokemon => {
      return (
        <Pokemon key={pokemon.id} pokemon={pokemon}/>
      )
    })
  }
}

export default Pokedex;
